import React from 'react';
import { LineChart, Line, CartesianGrid, XAxis, YAxis } from 'recharts';

type Game = {
  gameId: string,
  passingAttemptsAmt: number,
  passingCompletionsAmt: number,
  seasonYear: number
}

type PlayerDashboardGamePerformanceLineChartProps = {
  data: Game[]
}

export default ({ data }: PlayerDashboardGamePerformanceLineChartProps) => (
  <LineChart width={600} height={300} data={data}>
    <Line type="monotone" dataKey="passingAttemptsAmt" stroke="#8884d8" />
    <CartesianGrid stroke="#ccc" />
    <XAxis dataKey="gameId" />
    <YAxis />
  </LineChart>
)
